(function() {
    function removeFooter() {
        var footer = document.querySelector('footer');
        if (footer) {
            footer.remove();
        }
    }
    removeFooter();

})();

(function() {
    'use strict';
    function applyStylesAndHideElements() {
        document.querySelectorAll('.not-approved-title[data-testid="main-page-title"]').forEach(function(element) {
            if (element.textContent.trim() === 'Account Deleted') {
                const standards = document.querySelector('div[data-testid="community-standards"]');
                if (standards) {
                    standards.style.display = 'none';
                }
            }
        });
    }
    window.addEventListener('load', applyStylesAndHideElements);
    const observer = new MutationObserver(applyStylesAndHideElements);
    observer.observe(document.body, { childList: true, subtree: true });
})();
(function() {
    'use strict';

    function hideEmptyModeratorNotes() {
        document.querySelectorAll('p').forEach(p => {
            if (p.textContent.includes('Moderator Note:')) {
                p.style = "padding-top: 1px; padding-bottom: 0px; margin-bottom: 11px; font-size: 14px!important;"
            }
            if (p.textContent.includes('Moderator Note:') && p.querySelector('b') && p.querySelector('b').textContent.trim() === '') {
                p.style = "display:none;"
            }
        });
    }

    window.addEventListener('load', function() {
        const observer = new MutationObserver((mutations, observer) => {
            const target = document.querySelector('div.not-approved-info-section p');
            if (target) {
                hideEmptyModeratorNotes();
                observer.disconnect();
            }
        });

        observer.observe(document.body, {
            childList: true,
            subtree: true
        });
    });
})();
(function() {
    'use strict';

    function styleAndAddElements() {
        var strongElements = document.querySelectorAll('.not-approved-punishment-details-item-row > strong');
        strongElements.forEach(function(strongElement) {
            var text = strongElement.textContent.trim();
            if (text.startsWith('Asset ID:') || text.startsWith('Asset Name:') || text.startsWith('Asset Version ID:') || text.startsWith('Asset Hash ID:')) {
                strongElement.style.textAlign = 'center';
                strongElement.style.fontWeight = 'bold';
                strongElement.classList.add('original-strong');

                if (!strongElement.nextElementSibling || strongElement.nextElementSibling.tagName !== 'STRONG') {
                    var newStrongElement = document.createElement('strong');
                    newStrongElement.classList.add('custom-strong');
                    newStrongElement.textContent = 'If moderated, 0 Assets will be affected';
                    newStrongElement.style.margin = '2px 0px 0px 0px';
                    newStrongElement.style.padding = '0px 40px';

                    strongElement.parentNode.insertBefore(newStrongElement, strongElement.nextSibling);

                    var image1 = document.createElement('img');
                    image1.src = 'data:image/png;base64,';
                    image1.title = '[ Content Deleted ]';
                    image1.style.width = '300px';
                    image1.style.height = '250px';
                    image1.style.margin = '0px 40px 2px 40px';
                    image1.style.cursor = 'pointer';
                    image1.classList.add('image1')
                    strongElement.parentNode.insertBefore(image1, newStrongElement.nextSibling);

                    var image2 = document.createElement('img');
                    image2.src = 'data:image/png;base64,';
                    image2.title = '[ Content Deleted ]';
                    image2.style.width = '250px';
                    image2.style.height = '250px';
                    image2.style.margin = '16px 40px 0px 40px';
                    image2.style.cursor = 'pointer';
                    image2.classList.add('image2')
                    strongElement.parentNode.insertBefore(image2, newStrongElement.nextSibling);
                }
            }
        });
    }
    function hideSxlContent() {
        document.querySelectorAll('p.not-approved-punishment-details-item-row:nth-child(1) > strong:nth-child(1)').forEach(function(strongElement) {
            if (strongElement.textContent.trim() === 'Sexual Content' ||
                strongElement.textContent.trim() === 'Child Exploitation' ||
                strongElement.textContent.trim() === 'Child Endangerment' ||
                strongElement.textContent.trim() === 'Violent Content and Gore' ||
                strongElement.textContent.trim() === 'Terrorism/Extremism') {
                document.querySelectorAll('.original-strong').forEach(function(originalStrong) {
                    originalStrong.style.display = 'none';
                });
                document.querySelectorAll('.custom-strong').forEach(function(customStrong) {
                    customStrong.style.display = 'none';
                });
                document.querySelectorAll('.image2').forEach(function(imgElement2) {
                    imgElement2.style.display = 'block';
                    imgElement2.src = 'https://images.rbxcdn.com/dbe3f1d007be3c66d67d1e03e47fe366.png';
                    imgElement2.style.width = '150px';
                    imgElement2.style.height = '190px';
                    imgElement2.style.margin = "15px auto 15px auto";
                    imgElement2.title = '[ Content Blocked ]';
                });
                document.querySelectorAll('.image1').forEach(function(imgElement1) {
                    imgElement1.style.display = 'none';
                });
            }
        });
    }
    function audioBans() {
        document.querySelectorAll('p.not-approved-punishment-details-item-row:nth-child(1) > strong:nth-child(1)').forEach(function(strongElement) {
            if (strongElement.textContent.trim() === 'Disruptive Audio') {
                document.querySelectorAll('.image2').forEach(function(imgElement2audio) {
                    imgElement2audio.src = ' data:image/png;base64,';
                    imgElement2audio.style = 'height:250px; width:250px; margin:20px 40px 0px 40px!important; cursor:pointer; display:block;';
                    imgElement2audio.classList.add('image2audio')
                });
                document.querySelectorAll('.image1').forEach(function(imgElement1audio) {
                    imgElement1audio.src = ' data:image/png;base64,';
                    imgElement1audio.style = 'object-fit:scale-down; height:250px; width:300px; margin:0px 40px 16px 40px!important; cursor:pointer; display:block;';
                    imgElement1audio.classList.add('image1audio')
                });
            }
        });
    }
    function applyAllStyles() {
        styleAndAddElements();
        hideSxlContent();
        audioBans();
    }
    applyAllStyles();
    const observer = new MutationObserver(applyAllStyles);
    observer.observe(document.body, { childList: true, subtree: true });
})();
(function() {
    'use strict';
    function replaceBannedText() {
        let elements = document.querySelectorAll('.not-approved-title');
        elements.forEach(function(element) {
            if (element.textContent.trim() === 'Banned for 6 Months') {
                element.textContent = 'Banned for 183 Days';
            }
        });
        elements.forEach(function(element) {
            if (element.textContent.trim() === 'Banned for 1 Year') {
                element.textContent = 'Banned for 365 Days';
            }
        });
    }
    replaceBannedText();
    const observer = new MutationObserver(function(mutations) {
        mutations.forEach(function(mutation) {
            replaceBannedText();
        });
    });
    observer.observe(document.body, { childList: true, subtree: true });
})();
(function() {
    'use strict';

    function cautionkill() {
        const foreshadowDivs = document.querySelectorAll('div[data-testid="foreshadow"]');
        foreshadowDivs.forEach(div => {
            div.remove();
            const notApprovedTitle = document.querySelector('.not-approved-title');
            if (notApprovedTitle) {
                notApprovedTitle.style.marginBottom = '0';
            }
        });
    }

    window.addEventListener('load', cautionkill);

    const observer = new MutationObserver(cautionkill);
    observer.observe(document.body, { childList: true, subtree: true });

})();

(function() {
     'use strict';
     document.title = 'Roblox | Disabled Account';
})();
